webpackJsonp([0x83b93ae6ccd9],{3865:function(n,i){n.exports={data:{markdownRemark:{html:'<p>メインPCとして使用すべく、<a href="/cf-w2d">Let\'sNote</a>を下取りして購入。3D 能力もデスク並に強化されさらにはノートでは珍しい RAID-1 対応。(これが購入の一番のきっかけとなった)  サウンド部にウォークマンみたいな重低音増強機能が仕込まれているみたいで、DTM するときは泣かされている。(いや大人しくUSB音源買えって話なんですがｗ) 長らく主力 PC として活動してきたが、排熱ファンがすこぶる不調で、2010年晩秋にグラボが溶けてお亡くなり。</p>\n<h2>当時はまったPCゲーム</h2>\n<ul>\n<li>\n<p>東方モノ全般</p>\n</li>\n<li>\n<p>ひぐらしのなく頃に</p>\n</li>\n<li>\n<p>Ragnarok Online</p>\n<h2>製作物・他やってたこと</h2>\n</li>\n<li>\n<p><a href="/!/thC/">東方夢終劇</a></p>\n</li>\n<li>\n<p><a href="/!/leila/">Leila Prismriver</a></p>\n</li>\n<li>\n<p><a href="/!/dst/">danmaq soundtrack</a></p>\n</li>\n<li>\n<p><a href="http://kagaminer.in/">結界幻想禄 鏡</a>(プロトタイプ～体験版まで)</p>\n<h2>性能</h2>\n</li>\n<li>\n<p>CPU:intel Pentium M 730(Dothan/1.6GHz)</p>\n</li>\n<li>\n<p>RAM:1.5GB(PC2-4200)</p>\n</li>\n<li>\n<p>VGA:nVidia GeForceGo6200TE(VRAM64MB)</p>\n</li>\n<li>\n<p>HDD:80GB*2(RAID1)</p>\n</li>\n<li>\n<p>CDD:(NONE)</p>\n</li>\n<li>\n<p>FDD:(NONE/代わりにSDカードスロットが)</p>\n</li>\n<li>\n<p>NET:100Base-TX/IEEE802.11b&#x26;g/56kbpsFaxModem</p>\n</li>\n<li>\n<p>SOUND:DTMするには微妙(強制重低音増強機能)</p>\n</li>\n<li>\n<p>OS:Windows7 Ultimate\n<strong>Windows Experience Index</strong> Vistaでは最低スコアが2.4(ゲーム用グラフィックス)だった。7ではグラボ周りのエラーで計測できず。</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"2005-08-18T19:00:00+09:00",strDate:"2005/8/18",title:"(2005-2010) TOSHIBA dynabookSS/LX190"}}},pathContext:{path:"/ja/blog/2005/08/18-palx190dr/",langKey:"ja"}}}});
